   [133]={next_id=134, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="从列车下来后，泽菲琳的情绪仍有些波动，正在蒂雅的家族，阿斯特利亚家中修养。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
