   [135]={next_id=136, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="你将她带回后，我去骑士团的资料库里调取了这孩子的资料，结合对她的一些询问，我发现了一些值得注意的东西。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [136]={next_id=137, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="虽然从履历上看只是一个普通的少女，但她的母亲……却不一样。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [137]={next_id=138, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="维拉提亚最强大的那位命星骑士……她有两个养女，泽菲林的母亲就是其中之一。而那名骑士在一场星罚中战死，她的母亲和另一个养女因此失踪了很长时间。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [138]={next_id=139, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="当她的母亲再一次出现时，已经是化名的普通人。她伪造了自己的身份，生活在星都。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [139]={next_id=140, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="而另一个养女……至今没人知道她在哪，也没人知道她的名字。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
